  PyDict_SetItemString(md, "cvar", globals);
  Py_DECREF(globals);
  SWIG_addvarlink(globals, "FlowModel_undirected", Swig_var_FlowModel_undirected_get, Swig_var_FlowModel_undirected_set);
  SWIG_addvarlink(globals, "FlowModel_directed", Swig_var_FlowModel_directed_get, Swig_var_FlowModel_directed_set);
  SWIG_addvarlink(globals, "FlowModel_undirdir", Swig_var_FlowModel_undirdir_get, Swig_var_FlowModel_undirdir_set);
  SWIG_addvarlink(globals, "FlowModel_outdirdir", Swig_var_FlowModel_outdirdir_get, Swig_var_FlowModel_outdirdir_set);
  SWIG_addvarlink(globals, "FlowModel_rawdir", Swig_var_FlowModel_rawdir_get, Swig_var_FlowModel_rawdir_set);
  
  // thread safe initialization
  swig::container_owner_attribute();
  
#if PY_VERSION_HEX >= 0x03000000
  return m;
#else
  return;
#endif
